                    .then((res) => res.json())
                    .then((json) => {
                        console.log(json['results']);
                    })

  return (

    <div id="sidebar">
          <p>Contacts</p>
          <div>
            <form id="search-form" role="search">
              <input
                id="q"
                aria-label="Search contacts"
                placeholder="Search"
                type="search"
                name="q"
              />
              <div
                id="search-spinner"
                aria-hidden
                hidden={true}
              />
              <div
                className="sr-only"
                aria-live="polite"
              ></div>
            </form>
          </div>
          <nav>
            <ul>
              <li>
                <div class='gg'>
                    <nav>
                        <ul>
